function aninCloseBtn() {
  var l1 = tn(this, 'path')[0];
  var l2 = tn(this, 'path')[1];
  l1.style.transform = "translate(49px, 50px) rotate(45deg) translate(-49px, -50px)";
  l1.style.transition = "all 233ms";
  l2.style.transform = "translate(49px, 50px) rotate(135deg) translate(-49px, -50px)";
  l2.style.transition = "all 233ms";
}

function anoutCloseBtn() {
  var l1 = tn(this, 'path')[0];
  var l2 = tn(this, 'path')[1];
  l1.style.transform = "translate(49px, 50px) rotate(225deg) translate(-49px, -50px)";
  l1.style.transition = "all 233ms";
  l2.style.transform = "translate(49px, 50px) rotate(225deg) translate(-49px, -50px)";
  l2.style.transition = "all 233ms";
}

function dragElement() {
  var el = this.parentElement;
  var pos1 = 0,
    pos2 = 0,
    pos3 = 0,
    pos4 = 0;
  if (document.getElementById(this.id)) document.getElementById(this.id).onmousedown = dragMouseDown;
  else this.onmousedown = dragMouseDown;

  function dragMouseDown(e) {
    pos3 = e.clientX;
    pos4 = e.clientY;
    document.onmouseup = closeDragElement;
    document.onmousemove = elementDrag;
  }

  function elementDrag(e) {
    pos1 = pos3 - e.clientX;
    pos2 = pos4 - e.clientY;
    pos3 = e.clientX;
    pos4 = e.clientY;
    el.style.top = (el.offsetTop - pos2) + "px";
    el.style.left = (el.offsetLeft - pos1) + "px";
    el.style.opacity = "0.85";
    el.style.transition = "opacity 700ms";
  }

  function closeDragElement() {
    document.onmouseup = null;
    document.onmousemove = null;
    el.style.opacity = "1";
  }
}



function createSearchHTML(){
  if (gi(document, 'command_loopup_cont')) gi(document, 'command_loopup_cont').outerHTML = '';

  var cont = ele('div');
  a(cont, [    ['id', 'command_loopup_cont'],    ['style', `position: fixed; top: 100px; left: 20%; z-index: ${new Date().getTime()}; width: 600px; border: 3px solid #004471; border-radius: 0.4em; background: #fff; padding: 0px;`]  ]);
  document.body.appendChild(cont);

  var head = ele('div');
  a(head, [    ['style', `width: 100%; background: #0a1114; border: 1.6px solid #0a1114; border-top-left-radius: 0.4em; border-top-right-radius: 0.4em; cursor: move;`]  ]);
  cont.appendChild(head);
  head.onmouseover = dragElement;

  var txt = ele('span');
  a(txt, [     ['style', `color: #fff; font-size: 1.1em; cursor: pointer; border-radius: 0.5em;`]  ]);
  head.appendChild(txt);
  txt.innerText = 'English 2 German lookup';

  var cls = ele('div');
  a(cls, [    ['style', `width: 22px; height: 22px; cursor: pointer; float: right;`]  ]);
  head.appendChild(cls);
  cls.innerHTML = svgs.close;
  cls.onmouseenter = aninCloseBtn;
  cls.onmouseleave = anoutCloseBtn;
  cls.onclick = () => cont.outerHTML = '';

  var cbod = ele('div');
  a(cbod, [ ['id','command_loopup_cbod'],   ['style', `width: 100%; border-bottom-right-radius: 0.4em; border-bottom-left-radius: 0.4em; background: #fff;`]  ]);
  cont.appendChild(cbod);

  var inputCont = ele('div');
  a(inputCont,[['style',`width: 100%;`]]);
  cbod.appendChild(inputCont)

  var cmd = ele('input');
  a(cmd, [['placeholder','command'],    ['style', `width: 80%; padding: 4px; border: 1px solid #004471; border-radius: 0.4em; `]  ]);
  inputCont.appendChild(cmd);
  cmd.onkeyup = getGermanFromEnglish;

}

function getGermanFromEnglish(e){
    var command = this.value;
    
  if(e.key == 'Enter'){
    var exact = command_table.filter(el=> el.some(ii=> ii[0].toLowerCase() == command.toLowerCase()));
    addSearchResultsHTML(exact);
    console.log(exact);
  }else if(command && command.length > 2){
    var matches = command_table.filter(el=> el.some(ii=> new RegExp(command.replace(/\+/,'\+'),'i').test(ii[0])));
    addSearchResultsHTML_auto(matches);
  }
}


function addSearchResultsHTML(objArr){
  if(gi(document,'command_loopup_res')) gi(document,'command_loopup_res').outerHTML = '';
  if(gi(document,'command_loopup_res1')) gi(document,'command_loopup_res1').outerHTML = '';
  if(gi(document,'command_input_res')) gi(document,'command_input_res').outerHTML = '';

  if(objArr && objArr.length){
    var inp = ele('textarea');
    a(inp, [['id','command_input_res'],['style',`border: 1px solid transparent; border-radius: .4em;`]]);
    gi(document,'command_loopup_cbod').appendChild(inp);
    inp.value = objArr[0].filter(el=> el[1] == 'de' )[0][0];
    inp.select();
    document.execCommand("copy");

    inp.outerHTML = '';
    var res = ele('div');
    a(res,[['id','command_loopup_res'],['style',`padding: 6px;`]]);
    gi(document,'command_loopup_cbod').appendChild(res);
    res.innerText = 'German:\n' +objArr[0].filter(el=> el[1] == 'de' )[0][0];
  }else{
    var res = ele('div');
    a(res,[['id','command_loopup_res'],['style',`padding: 6px;`]]);
    gi(document,'command_loopup_cbod').appendChild(res);
    res.innerText = 'no matches';
    
  }
}

function addSearchResultsHTML_auto(objArr){
  if(gi(document,'command_loopup_res1')) gi(document,'command_loopup_res1').outerHTML = '';
  if(gi(document,'command_loopup_res')) gi(document,'command_loopup_res').outerHTML = '';
  if(objArr && objArr.length){
    var res1 = ele('div');
    a(res1,[['id','command_loopup_res1'],['style',`padding: 6px; float: left; width: 50%; background: #fff; border-radius: 0.4em;`]]);
    gi(document,'command_loopup_cbod').appendChild(res1);
    var output = objArr && objArr.length ? objArr.map(ii=> '<div style="border-bottom: 1px solid #7c7c7c;">'+ii.filter(el=> el[1] == 'en' )[0][0] +'</div>').reduce((a,b)=> a+b) : '';
    res1.innerHTML = output ? '<div>English:</div>'+output : ''; 

    var res = ele('div');
    a(res,[['id','command_loopup_res'],['style',`padding: 6px; float: right; width: 50%; background: #fff; border-radius: 0.4em;`]]);
    gi(document,'command_loopup_cbod').appendChild(res);
    var output = objArr && objArr.length ? objArr.map(ii=> '<div style="border-bottom: 1px solid #7c7c7c;">'+ii.filter(el=> el[1] == 'de' )[0][0]+'</div>').reduce((a,b)=> a+b) : '';
    res.innerHTML = output ? '<div>German:</div>'+output : ''; 
  }
}


